insert  into `chat`(`IdChat`,`Preguntas`,`Respuestas`,`IdEstado`) values 
(1,'Como creo una cuenta Estudiante?','Para crear una cuenta ingresa a la opcion de ACCESO, selecciona la opcion Estudiantes, da clic en la opcion Registrate aqui, llena los datos y da clic en el boton registrar.',1),
(2,'Como hacer una consulta?','Copia el texto que determinas como palabras dificiles de comprender y pegalo en el cuadro de palabras complejas.',1),
(3,'¿Qué es un sinónimo?','Palabra, expresión que tiene el mismo significado que otra u otras palabras o expresiones.',1),
(4,'¿Tengo historial de busquedas?','En el menu seleciona la opcion Consultas, selecciona la lista de consultas y da clic en la palabra que deseas saber los sinonimos y definiciones.',1),
(5,'Como encuentro los sinonimos y definiciones','en la parte superior derecha el sistema muestra un cuadro con las palabras encontradas, da clic en la palabra que desees.',1),
(6,'¿Cómo realizo una consulta en el chat?','Despliega la interfaz hacia abajo para que aparesca el botón verde del chat, selecciona y escribe la pregunta y da clic en el boton Enviar.',1),
(7,'¿Que es una definición en un texto?','Conjunto de enunciados que componen un documento escrito.',1),
(8,'¿Qué son los componentes PLN?','Son características de procesamiento de textos en lenguaje natural, para saber mas da clic en el boton Leer mas.',1),
(9,'¿Cómo obtengo mas información de un proyecto de investigación?','Da clic sobre la imagen o sobre el título del proyecto.',1),
(10,'¿Qué es EwLex?','Es un sistema desarrollado para ayudar a entender palabras complejas, sinonimos y definiciones. ',1),
(11,'¿Cuál es el significado de EwLex?','Fácil con simplificación léxica',1),
(12,'¿Que son las publicaciones?','Son trabajos de investigación que se sube al sistema con fines informativos.',1),
(13,'¿Qué tiempo demora una consulta de chat?','La respuesta es instantánea ya que es interactivo.',1),
(14,'¿Que tecnología utiliza EwLex para el procesamiento del texto?','EwLex esta basado en las librerias nltk.corpus, nltk.tokenize y nltk.wordnet. Especificamente utiliza estas librerias para procesar el texto y encontrar las palabras.',1),
(15,'¿En que Lenguaje esta desarrollado EwLex?','EwLex esta desarrollado en el lenguaje Python',1),
(16,'¿Qué significa NLTK?','Natural Language ToolKit, donde se unen el procesamiento del lenguaje natural y Python.',1),
(17,'¿Que significa PLN?','El procesamiento del lenguaje natural (PLN) se refiere a la rama de la informática, y más específicamente a la rama de la inteligencia artificial o IA, que se ocupa de dar a las computadoras la capacidad de comprender textos y palabras habladas de la misma manera que los seres humanos.',1),
(18,'Puedo descargar una publicacion?','Si puedes descargarla, da clic en el boton Descargar y se realizará la descarga a tu dispotitivo.',1),
(19,'¿Cómo creo una cuenta Administrador?','Ponte en contacto con el administrador para que te facilite el usuario y clave.',1),
(23,'¿Cómo publico mi trabajo de investigación?','Para publicar tu trabajo de investigación debes ser usuario administrador.',1),
(24,'¿Qué consiraciones debo tomar al publicar un trabajo de investigación?','En el menu selecciona la opción Publicar Proyectos, tu documento debe estar en formato PDF.',1),
(25,'¿Qué es el ‘machine learning’?','El ‘machine learning’ –aprendizaje automático– es una rama de la inteligencia artificial que permite que las máquinas aprendan sin ser expresamente programadas para ello. Una habilidad indispensable para hacer sistemas capaces de identificar patrones entre los datos para hacer predicciones.',1);
